import React from "react";
import "./style.css";

import rectangle1 from "../../LandingPageImg/desktop-rectangle-1@2x.png";
import rectangle2 from "../../LandingPageImg/desktop-rectangle-copy-2@2x.png";
import rectangle3 from "../../LandingPageImg/desktop-rectangle-copy-3@2x.png";
import rectangle4 from "../../LandingPageImg/desktop-rectangle-copy-4@2x.png";
import rectangle5 from "../../LandingPageImg/desktop-rectangle-copy-5@2x.png";
import rectangle6 from "../../LandingPageImg/desktop-rectangle-copy-6@2x.png";
import rectangle7 from "../../LandingPageImg/desktop-rectangle-copy-7@2x.png";
import rectangle8 from "../../LandingPageImg/desktop-rectangle-copy-8@2x.png";
import rectangle9 from "../../LandingPageImg/desktop-rectangle-copy-9@2x.png";
import rectangle13 from "../../LandingPageImg/desktop-rectangle-copy-13@2x.png";
import rectangle14 from "../../LandingPageImg/desktop-rectangle-copy@2x.png";
import rectangle15 from "../../LandingPageImg/desktop-rectangle@2x.png";


const firstDivStyle ={
margin:"0",
background: "rgba(22,24,56,1.0)"

};
const startStyle ={
  width: "1024px",
   height: "100%",
    position:"relative",
     margin:"auto"
};


function LandingPage(){
  return (
    <div style="margin: 0;
 background: rgba(23, 24, 65, 1.0);">
        <input id="anPageName" name="page" type="hidden" value="landingpage"/>
        <div class="landingpage anima-word-break ">
            <div style="width: 1024px; height: 100%; position:relative; margin:auto;">
                <div class="grouped">
                    Grouped
                </div>
                <div class="asafeandeasyplac">
                    A Safe and Easy Place to Find and Create Events Near You
                </div>
                <div class="register anima-smart-layers-pointers ">
                    <span class="span1">Register</span><span class="span2"><br /></span>
                </div>
                <div class="login anima-smart-layers-pointers ">
                    Login
                </div>
                <img alt="Image" anima-src="./img/landing-page-rectangle-copy-3@2x.png" class="rectangle anima-animate-enter" src="data:image/gif;base64,R0lGODlhAQABAIAAAP///wAAACH5BAEAAAAALAAAAAABAAEAAAICRAEAOw=="/>
                <img alt="Image" anima-src="./img/landing-page-rectangle-copy@2x.png" class="rectanglecopy anima-animate-enter1" src="data:image/gif;base64,R0lGODlhAQABAIAAAP///wAAACH5BAEAAAAALAAAAAABAAEAAAICRAEAOw=="/>
                <img alt="Image" anima-src="./img/landing-page-rectangle-copy-2@2x.png" class="rectanglecopy2 anima-animate-enter2" src="data:image/gif;base64,R0lGODlhAQABAIAAAP///wAAACH5BAEAAAAALAAAAAABAAEAAAICRAEAOw=="/>
                <img alt="Image" anima-src="./img/landing-page-rectangle-copy-3@2x.png" class="rectanglecopy3" src="data:image/gif;base64,R0lGODlhAQABAIAAAP///wAAACH5BAEAAAAALAAAAAABAAEAAAICRAEAOw=="/>
                <img alt="Image" anima-src="./img/landing-page-rectangle-copy-3@2x.png" class="rectanglecopy4" src="data:image/gif;base64,R0lGODlhAQABAIAAAP///wAAACH5BAEAAAAALAAAAAABAAEAAAICRAEAOw=="/>
                <img alt="Image" anima-src="./img/landing-page-rectangle-1@2x.png" class="rectangle1 anima-animate-enter3" src="data:image/gif;base64,R0lGODlhAQABAIAAAP///wAAACH5BAEAAAAALAAAAAABAAEAAAICRAEAOw=="/>
                <img alt="Image" anima-src="./img/landing-page-rectangle-copy-8@2x.png" class="rectanglecopy8 anima-animate-enter4" src="data:image/gif;base64,R0lGODlhAQABAIAAAP///wAAACH5BAEAAAAALAAAAAABAAEAAAICRAEAOw=="/>
                <img alt="Image" anima-src="./img/landing-page-rectangle-copy-9@2x.png" class="rectanglecopy9 anima-animate-enter5" src="data:image/gif;base64,R0lGODlhAQABAIAAAP///wAAACH5BAEAAAAALAAAAAABAAEAAAICRAEAOw=="/>
                <img alt="Image" anima-src="./img/landing-page-rectangle-copy-3@2x.png" class="rectanglecopy5 anima-animate-enter6" src="data:image/gif;base64,R0lGODlhAQABAIAAAP///wAAACH5BAEAAAAALAAAAAABAAEAAAICRAEAOw=="/>
                <img alt="Image" anima-src="./img/landing-page-rectangle-copy-3@2x.png" class="rectanglecopy6 anima-animate-enter7" src="data:image/gif;base64,R0lGODlhAQABAIAAAP///wAAACH5BAEAAAAALAAAAAABAAEAAAICRAEAOw=="/>
                <img alt="Image" anima-src="./img/landing-page-rectangle-copy-13@2x.png" class="rectanglecopy13 anima-animate-enter8" src="data:image/gif;base64,R0lGODlhAQABAIAAAP///wAAACH5BAEAAAAALAAAAAABAAEAAAICRAEAOw=="/>
                <img alt="Image" anima-src="./img/landing-page-rectangle-copy-7@2x.png" class="rectanglecopy7 anima-animate-enter9" src="data:image/gif;base64,R0lGODlhAQABAIAAAP///wAAACH5BAEAAAAALAAAAAABAAEAAAICRAEAOw=="/>
            </div>
        </div>
    </div>
  );
};
export default LandingPage;
